import cooperationImage from '../assest/image/png/cooperationImage.png';

export const COOPERATION_INFO = {
    text: 'Tiver Group является ведущей компанией в сфере информационного моделирования Building Information Modeling (BIM). Широкий спектр услуг помогает повысить качество и эффективность проектирования, строительства и дальнейшей эксплуатации объектов',
    img: {img: cooperationImage, alt: 'cooperationImage'},
}
